import React, { Component } from "react";
import {
    Container, Row, Col
} from 'react-bootstrap';
import emailjs from 'emailjs-com';
// import { init } from 'emailjs-com';
// init("user_1I17qEirtZkLAh5ed5qOv");

function sendEmail(e) {
    e.preventDefault();

    emailjs.sendForm('YOUR_SERVICE_ID', 'YOUR_TEMPLATE_ID', e.target, 'YOUR_USER_ID')
        .then((result) => {
            console.log(result.text);
        }, (error) => {
            console.log(error.text);
        });
}

class Demo extends Component {
    render() {
        return (
            <div className="component_content demo">
                <Container>
                    <Row>
                        <Col xs={12} xl={6}>
                            <form className="contact-form" onSubmit={sendEmail}>
                                <input type="hidden" name="contact_number" />
                                <label>Name</label>
                                <input type="text" name="user_name" />
                                <label>Email</label>
                                <input type="email" name="user_email" />
                                <label>Message</label>
                                <textarea name="message" />
                                <input type="submit" value="Send" />
                            </form>

                            <h2 class="text-blue">Get a demo</h2>
                            <form>
                                <div class="form-group">
                                    <input type="text" id="name" placeholder="Name" class="form-control"/>
                                </div>
                                <div class="form-group">
                                    <input type="text" id="yacht" placeholder="Yacht" class="form-control"/>
                                </div>
                                <div class="form-group">
                                    <input type="email" id="email" placeholder="Email" class="form-control"/>
                                </div>
                                <div class="form-group">
                                    <input type="text" id="phone" placeholder="Phone" class="form-control"/>
                                </div>
                                <div class="form-group">
                                    <input type="text" id="location" placeholder="Location" class="form-control"/>
                                </div>
                                    <button type="submit" class="btn btn-primary">
                                        Submit
                                    </button>
                                </form>
                        </Col>
                        <Col xs={12} xl={6}>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}

export default Demo;
